import React from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;

const Map = ({ apiKey }) => {
  const center = {
    lat: 55.7558,
    lng: 37.6173
  };
  const zoom = 5;
  return (
    <div style={{ height: '95vh', width: '100%' }}>
      <GoogleMapReact
        bootstrapURLKeys={{ key: apiKey }}
        defaultCenter={center}
        defaultZoom={zoom}
      >
        <AnyReactComponent
          lat={59.955413}
          lng={30.337844}
          text="St.Petersburg"
        />
        <AnyReactComponent
          lat={55.7558}
          lng={37.6173}
          text="Moscow"
        />
        <AnyReactComponent
          lat={53.268191}
          lng={107.499882}
          text="Moscow"
        />
      </GoogleMapReact>
    </div>
  );
};

export default Map;
